  return (
    <View style={styles.container}>
      <Text style={styles.textStyle} >Login Form</Text>
    
    </View>
  )
}



const styles = StyleSheet.create({
    container:{
      marginTop:50,
    },
    textStyle:{
        textAlign:'center',
        fontSize:30,
    },
    inputContainer:{
        marginTop:40,
        marginHorizontal:40,
    },
    input:{
        borderWidth:1,
        borderColor:'black',
        borderRadius:5,
       marginBottom:10,
       paddingVertical:5,
       paddingHorizontal:10,
    }
    
})

export default Practise;
